import IntegrationInstructionsRoundedIcon from '@mui/icons-material/IntegrationInstructionsRounded';
import DesignServicesRoundedIcon from '@mui/icons-material/DesignServicesRounded';
import HtmlRoundedIcon from '@mui/icons-material/HtmlRounded';
import CssRoundedIcon from '@mui/icons-material/CssRounded';
import JavascriptRoundedIcon from '@mui/icons-material/JavascriptRounded';
import TerminalTwoToneIcon from '@mui/icons-material/TerminalTwoTone';
import RocketLaunchRoundedIcon from '@mui/icons-material/RocketLaunchRounded';

const Services = () => {

    return (
        <div className="p-10 py-20 flex flex-col">
            <div className="pb-4 text-center text-lg font-semibold">SERVICES</div>

            <div className="grid md:grid-cols-2 gap-4">
                <div className="p-4 shadow hover:shadow-md rounded-md flex flex-col bg-accent">
                    <TerminalTwoToneIcon  />
                    <p className='text-secondary font-medium'>Backend Development</p>
                    <div className='flex gap-2'>
                        <JavascriptRoundedIcon />
                        python
                        flask
                        mySQL
                    </div>

                </div>

                <div className="p-4 shadow hover:shadow-md rounded-md flex flex-col bg-accent">
                    <DesignServicesRoundedIcon className='text-secondary' />
                    <p className='text-secondary font-medium'>Frontend Development</p>
                    <div className='flex gap-2'>
                        <HtmlRoundedIcon />
                        <CssRoundedIcon />
                        <JavascriptRoundedIcon />
                        react
                        tailwind
                    </div>
                </div>
            </div>

            <div className='p-4 shadow hover:shadow-md rounded-md flex flex-col bg-accent mt-4'>
                vscode
                github
                xampp
                figma
                framer
                webflow
            </div>
        </div>
    );
};

export default Services;
